import React from 'react';
import '../index.css';

export default class User extends React.Component {
    constructor(props) {
        super(props);

        this.state = {
            backgroundColor: 'white'
        }
    }

    render () {
        const { user } = this.props;

        return (
            <div class='user'>
                <div class='profileInfos'>
                        <div class='profileInfo'>
                            {`Prenom: ${user.name}`}
                        </div>
                        <div class='profileInfo'>
                            {`Nom: ${user.surname}`}
                        </div>
                        <div class='profileInfo'>
                            {`Date de naissance: ${user.birthdate}`}
                        </div>
                    </div>
            </div>
        )
    }

}
